@linngrant is one of the leaders in Women’s golf and ahead of the @aigwomensopen next week, it feels right to share a segment from last years AIG Women’s Open. 

During her rookie season in 2022, she notched up four wins including two on home soil. She became the first woman to win on the DP World tour, dominating the next best by 9 shots. Linn then had a further nine top-10 results that rocketed her up to number 24 in the Rolex Women’s World Golf Rankings. 

To watch the full video, you can visit my YouTube channel where Linn shares with us some brilliant insights in dealing with pressure! #YouTube #LinnGrant #Insights #AIGWomensOpen

